import React from "react"


const Parent = () => {
    console.log('Parent render')

    React.useEffect(() => {
        console.log('Parent effect render')
    }, [])

    return (
        <>
        <div>Parent</div>
        <Child />
        </>
    )
}

export default Parent

const Child = () => {
    console.log('Children render')

    React.useEffect(() => {
        console.log('Children effect render')
    }, [])

    return (
        <div>Children</div>
    )
}
